import { Component } from '@angular/core';


@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'front';
  folderDataSource = [
    {
      name: 'Folder 1',
      children: [
        { name: 'Subfolder 1.1', children: [{ name: 'File 1.1.1' }, { name: 'File 1.1.2' }] },
        { name: 'Subfolder 1.2', children: [{ name: 'File 1.2.1' }, { name: 'File 1.2.2' }] }
      ]
    },
    {
      name: 'Folder 2',
      children: [
        { name: 'Subfolder 2.1', children: [{ name: 'File 2.1.1' }, { name: 'File 2.1.2' }] },
        { name: 'Subfolder 2.2', children: [{ name: 'File 2.2.1' }, { name: 'File 2.2.2' }] }
      ]
    }
  ];
}
